        align-items: center;
        gap: 16px;
        margin-bottom: 40px;

        @include mq.mq(large) {
            flex-direction: column;
        }
    }

    &__info {
        display: flex;
        align-items: center;
        padding: 17px 20px 17px 10px;
        max-width: 580px;
        background-color: #e4e4e470;
        border-radius: 30px;

        @include mq.custom-mq(400px) {
            flex-direction: column;
            font-size: 1.4rem;
        }

        > img {
            display: block;
        }

        &-text {
            margin-block: 0;
            text-align: center;
            > .bolder {
                display: block;
                font-weight: 600;
            }
        }
    }

    &__guarante-block {
        > .guarante-block {
            background-color: #fff;
        }
    }

    &__wrapper {
        display: grid;
        grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
        column-gap: 16px;
        row-gap: 26px;
    }

    &__item {
        position: relative;
    }

    &__slider {
        overflow: hidden;
        max-width: 233px;
        width: 100%;
        margin-inline: auto;
        margin-block-end: 40px;

        &-img {
            display: block;
            width: 233px;
        }
    }

    &__slider-btn {
        position: absolute;
        top: 25%;
        left: 0;
        border: none;
        background-color: transparent;
        transform: translateX(50%);

        &:hover {
            cursor: pointer;
        }

        &--next {
            right: 0;
            left: auto;
            transform: translateX(-50%);
        }
    }

    &__price-type-wrapper {
        display: flex;
        align-items: center;
        position: absolute;
        left: 0;
        right: 0;
        top: 40%;
    }

    &__prices-wrapper {
        display: flex;
        flex-direction: column;
        flex-grow: 1;
    }

    &__price-block {
        border-radius: 999px;
        width: max-content;
        display: inline-flex;
        padding: 5px 10px 5px 20px;
        line-height: 100%;

        @include mx.pseudo($left: 4px, $top: 50%) {
            background-color: #fff;
            border-radius: 50%;
            width: 9px;
            height: 9px;
            transform: translateY(-50%);
        }

        &--old {
            font-size: 1.4rem;
            background-color: #bcbcbc;
        }

        &--new {
            margin-top: -3px;
            background-color: #ffcd0f;

            & .bolder {
                font-weight: 700;
            }
        }

        > span {
            display: block;
        }
    }

    &__type {
        width: 115px;
        height: 115px;
        background-image: url("../assets/imgs/material-type.png");
        background-repeat: no-repeat;
        background-size: cover;
        background-position: center center;
        @include mx.flex();
        color: fn.color("white");
        text-align: center;
        font-size: 1.5rem;
        padding: 15px;
    }

    %title-block {
        background-color: #ececec;
        text-align: center;
        padding: 2px;
    }

    &__color {

        &-title {
            @extend %title-block;
        }

        &-list {
            padding: 0;
            list-style: none;
            display: flex;
            align-items: center;
            justify-content: center;
            gap: 8px;
            margin-block: 25px;

            .products__color {
                width: 40px;
                height: 40px;
                border: 4px solid transparent;
                border-radius: 5px;

                &--active {
                    border-color: fn.color("primary");
                }

                &:hover {
                    cursor: pointer;
                }
            }
        }

        &-grey {
            background-color: #d5d0be;
        }

        &-brown {
            background-color: #493232;
        }
    }

    &__desc {
        display: -webkit-box;
        -webkit-line-clamp: 4;
        -webkit-box-orient: vertical;
        overflow: hidden;
        
        &--active {
            display: block;
        };

        &-title {
            @extend %title-block;
        }

        &-read-more {
            color: fn.color("text-color");
        }
    }
}

.item-product {
    max-width: 380px;

    &__name {
        font-weight: 600;
    text-align: center;

    }

    &__info {
        text-align: center;
